window.bookSummaryJSON = "<p><b>Relive the sensuality, the romance, and the drama of&nbsp;</b><b><i>Fifty Shades Freed</i></b><b>&nbsp;through the thoughts, reflections, and dreams of Christian Grey.</b></p> <p><b>E. L. James revisits the world of Fifty Shades with a deeper and darker take on the love story that has enthralled millions around the globe.</b></p> <p>You are cordially invited to the wedding of the decade, when Christian Grey will make Anastasia Steele his wife. But is he really husband material? His dad is unsure, his brother wants to organize one helluva bachelor party, and his fiancée won’t vow to obey....</p> <p>And marriage brings its own challenges. Their passion for each other burns hotter and deeper than ever, but Ana’s defiant spirit continues to stir Christian’s darkest fears and tests his need for control. As old rivalries and resentments endanger them both, one misjudgment threatens to tear them apart.</p> <p>Can Christian overcome the nightmares of his childhood and the torments of his youth and save himself? And once he’s discovered the truth of his origins, can he find forgiveness and accept Ana’s unconditional love?</p> <p>Can Christian finally be freed?</p>"; 
